import React from "react";

const TodoList = ({ todos }) => {
    return (
        <div>
            <h2>Extracted Todos</h2>
            {todos.length === 0 ? (
                <p>No todos found</p>
            ) : (
                <ul>
                    {todos.map((todo, index) => (
                        <li key={index}>
                            <strong>{todo.task}</strong> - <span>{todo.status}</span> (Deadline: {todo.deadline || "N/A"})
                        </li>
                    ))}
                </ul>
            )}
        </div>
    );
};

export default TodoList;
